import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";

class Landing extends Component {
  render() {
    return (
      <div className="landing-main">
        <img
          src="/img/logo.png"
          className="avatar-img"
          alt="Trasporti Amatrudo s.r.l."
        />
      </div>
    );
  }
}

export default Landing;
